import React, { Component } from "react";
import MainWindow from "./Cmps/PlayersAndNBALeagueLeaders/MainWindow";
import MainBar from "./Cmps/ToolBar/MainBar";
import Functions from './Functions'

const axios = require("axios").default;

class App extends Component {
  state = { season_leaders_players: "", nab_league_leaders: "" };
  componentDidMount() {
    this.start_localhost().then((season_leaders_players) => {
      this.setState({
        season_leaders_players: season_leaders_players.data.express.items[0],
        nab_league_leaders: season_leaders_players.data.express.items[1],
      });
    });
  }

  // start_localhost = async () => {
  //   const response = await axios.get("http://localhost:5000");
  //   console.log('xxx');
  //   return response;
  // };

  render() {
    return (
      <section className="App">
        <MainBar />
        <div className="season_leaders_players">
          <MainWindow
            items={this.state.season_leaders_players.items}
            title={this.state.season_leaders_players.title}
            like={(like_data) => {
              Functions.add_to_favorites(like_data,'DbFavoritesPlayers.json')
            }}
          />
        </div>
        <div className="nab_league_leaders">
          <MainWindow
            items={this.state.nab_league_leaders.items}
            title={this.state.nab_league_leaders.title}
            like={(like_data) => {
              Functions.add_to_favorites(like_data,'DbFavoritesTeams.json')
            }}
          />
        </div>
      </section>
    );
  }
}

export default App;
